import React, { useEffect } from "react";
import style from '../../assets/css/App.styles'
import { Select, InputLabel, FormControl } from "@material-ui/core";
import { Catalogo } from "../../zustand/types";

export default React.memo(function CustomSelect(this: any, {
  contenido,catalogo
}: Catalogo){

  const classes = style();


  let optionList = contenido.length > 0
  && contenido.map((item, i) => {
  return (
    <option key={i} value={item.id}>{item.description}</option>
  )
}, this);


  return (
    <div  style={{width:'100%'}}>
      <FormControl variant="outlined" className={classes.formControl} style={{ padding: "5px",width:'100%' }}>
        <InputLabel htmlFor="outlined-age-native-simple">{catalogo}</InputLabel>
        <Select style={{
          borderRadius: "30px",
          width: '100%',
          borderColor: "blue",
          marginLeft:'3%',
          marginBottom: "3%"
        }}
          native
          label="data"
          inputProps={{
            name: 'data',
            id: 'outlined-age-native-simple',
          }}
        >
          {optionList}

        </Select>
      </FormControl>

    </div>
  );


});
